literals:
box-sizing: border-box;
  border: 0px solid #000000;
  box-shadow: 0px 0px 4px 2px #e2e8f0;
  background: #ffffff;
  border-radius: 18px;
  width: 70%;
  height: fit-content;
  padding: 1%;
  padding-top: 0.2%;
  padding-bottom: 0.2%;
  margin: auto;
  margin-top: 2.5%;

  @media (max-width: 900px) {
    width: 90%;
  }

  @media (max-width: 650px) {
    box-shadow: 0 0 0 0;
    height: 100%;
    margin: auto;
    padding: 0%;
    width: 100%;
    background: #f7fafc;
  }

position: relative;
  top: -20%;
  font-size: 1rem;
  text-align: center;

display: grid;
  text-align: center;
  margin-left: auto;
  margin-right: auto;
  width: 90%;
  height: fit-content;
  padding: 0.5rem;
  box-shadow: 0px 0px 4px 2px #e2e8f0;
  background: #ffffff;
  border-radius: 18px;
  background-color: white;
  z-index: 1;

  @media (max-width: 650px) {
    width: 95%;
  }

padding: 0.5rem;
  background: #ffffff;
  background-color: white;
  overflow: hidden;
  height: auto;
  z-index: 1;

  @media (max-width: 650px) {
    position: absolute;
    top: 10vh;
    width: fit-content;
    box-shadow: none;
  }

margin: auto;
  max-width: 60%;

  @media (max-width: 650px) {
    margin: auto;
    top: 5rem;
  }

position: relative;
  top: 20%;
  font-size: 1rem;
  text-align: center;
  margin-bottom: 2%;

position: relative;
  border-radius: 6px;
  border: 1px solid #e2e8f0;
  width: 98%;
  height: 50px;
  font-size: 1rem;
  font-family: "Calibri";
  padding: 5px;

  &::focus {
    border-color: #97c0e6;
  }

background-color: white;
  border-radius: 6px;
  border: 1px solid #e2e8f0;
  height: fit-content;
  padding: 5px;
  margin-right: 5px;
  font-family: 'Calibri';

width: 6rem;
  height: 6rem;
  border: 2px solid black;
  margin: auto;
  border-radius: 180px;
  background-color: black;

display: grid;
  grid-template-columns: repeat(3, 2fr);
  grid-auto-rows: fit-content;
  grid-gap: 0.5rem;

  @media (max-width: 900px) {
    display: grid;
    grid-template-columns: repeat(2, 2fr);
    grid-auto-rows: fit-content;
  }

  @media (max-width: 650px) {
    display: grid;
    grid-template-columns: repeat(2, 2fr);
    grid-auto-rows: fit-content;
    grid-gap: 1rem;
  }

  @media (max-width: 380px) {
    display: grid;
    grid-template-columns: repeat(1, 2fr);
    grid-auto-rows: fit-content;
  } ;

height: fit-content;
  z-index: 1;
  width: 70%;
  margin: auto;

  @media (max-width: 900px) {
    width: 97%;
  }

  @media (max-width: 650px) {
    position: absolute;
    top: 10vh;
    box-shadow: none;
  }
